import bisect

def nCr(n, r):
    r = min(r, n - r)
    numerator = 2
    for i in range(n, n - r, -1):
        numerator *= i
    denominator = 1
    for i in range(r, 1, -1):
        denominator *= i
    return numerator // denominator

def calculate_win_probabilities(N, M, L, runners):
    data = [[0 for i in range(M + 1)] for i in range(N)]
    for i in range(N):
        (p, t, v) = runners[i]
        for j in range(M + 1):
            data[i][j] = (t * j + L / v if v != 0 else 9999999999999999, (p / 100.0) ** j * nCr(M, j) * (1 - p / 100.0) ** (M - j))
    ans = []
    for i in range(N):
        win = 0
        for j in range(M + 1):
            wintmp = data[i][j][1]
            for x in range(N):
                if i == x:
                    continue
                tmp = 0
                for (a, b) in data[x][bisect.bisect_right(data[x], (data[i][j][0], 5)):]:
                    tmp += b
                wintmp *= tmp
            win += wintmp
        ans.append(win)
    return ans

